import React, {Component} from 'react';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
 
export class MapContainer extends Component {
  render() {
      
    return (
        <Map google={this.props.google} 
        initialCenter={{
            lat: 18.796143,
            lng: 98.979263
          }}
        zoom={10}>
 
        <Marker onClick={this.onMarkerClick}
                name={'Current location'} />
        <Marker name={'Mingmitr Coffee'}  position={{lat: 18.733393, lng: 98.950960}} />
        <Marker name={'Wake up Coffee'}  position={{lat: 18.725492, lng: 98.947603}} />
        <Marker name={'Starbucks Coffee'}  position={{lat: 18.794608, lng: 98.977948}} />
 
        <InfoWindow onClose={this.onInfoWindowClose}>
            
        </InfoWindow>
      </Map>

    
    );
  }
}
 
export default GoogleApiWrapper({
  apiKey: ("AIzaSyCS4QDM_de0JGU7Qux2xa4VhxtVdmgXRJA")
})(MapContainer)
